       "descr":"<div>As the Ice Age came to an end, North America lost a stunning variety of animals. Mammoths, mastodon, llamas, ground-dwelling sloths the size of elephants, beavers the size of bears, pronghorn antelope the size of poodles, and carnivores to chase them—sabertooth cats, dire wolves, American lions and cheetahs; these and many more were gone by 10,000 years ago. <I>Giant Sloths and Sabertooth Cats </I>surveys all these animals, with a particular focus on the Great Basin. The book also explores the major attempts to explain the extinctions. Because some believe that they were due to the activities of human hunters, the author also reviews the archaeological evidence left by the earliest known human occupants of the Great Basin, showing that people were here at the same time and in the same places as many of the extinct animals. </div><div> <BR> Were these animals abundant in the Great Basin? A detailed analysis of the distinctive assemblages of plants that now live in this region leads to a surprising, and perhaps controversial, conclusion about those abundances. <BR>  <BR> If you are interested in Ice Age mammals or in the Ice Age archaeology of North America, if you are interested in the natural history of the Great Basin or the ways in which the plants of today’s landscapes might be used to understand the deeper past, you will be fascinated by this book.  </div>",
