       "tags":"Baker -- Chats.;Taylor -- Chats.;Chats de bibliothèque -- Minden (Nevada);Scottish Fold (Race féline)",
       "pagesinfile":"0",
       "descr":"<p>\"Not since George Bailey in <i>It's a Wonderful Life</i> has someone so lifted the spirits of an entire community. That the 'someone' in this case is, in fact, two library cats makes this true tale of the love of literature combined with a fondness for nose licking all the more magical. This book, like a purring kitten who may also be a genie, should be welcomed into any home.\"―Francesco Marciuliano, <i>New York Times</i> bestselling author of <i>I Could Pee on This: And Other Poems by Cats</i></p><p>It all started with mice in the library.</p><p>Assistant librarian Jan Louch and a coworker decided that what the library needed was a cat. Or, even better, two cats. Soon, they found a pair of Scottish Folds who were perfect for the job. Jan named them Baker and Taylor, and they took up residence in the library. </p><p>But these cats were much more than mousers. Visitors to the library fell in love with Baker and Taylor and their antics just as Jan had. And then, after Jan let the cats be photographed for a poster, they became feline celebrities. Children from across the country wrote them letters, fans traveled from far and wide to meet them, and they became the most famous library cats in the world. </p><p>In <i>The True Tails of Baker and Taylor, </i>Jan Louch looks back and tells the remarkable story of these two marvelous cats and the people―readers, librarians, and cat lovers of all ages―who came together around them.</p>",
