       "pagesinfile":"259",
       "descr":"Sir Elton John, blind fish, the original Twinkie, President Ronald Reagan's Secret Service detail, and mummies don't usually come up in the same conversation―unless you're at Mammoth Cave National Park! Home to the earth's longest known cave system, this UNESCO World Heritage Site is one of the oldest tourist attractions in North America. Although this remarkable place has been immortalized in works ranging from Herman Melville's <I>Moby Dick</I> to H. P. Lovecraft's \"The Beast in the Cave,\" the realities of life at Mammoth Cave can be stranger than fiction.<br><br>In this charming book, Colleen O'Connor Olson takes readers on a tour through a labyrinth of topics. She discusses scientific subjects such as the fossils of prehistoric animals and the secret lives of subterranean critters, and she provides essential information on dating in the cave (the age of rocks and artifacts, not courtship). Olson also explores Mammoth Cave's rich history, covering its use as the world's first tuberculosis sanatorium as well as its operation as a saltpeter mine during the War of 1812, and shares the inspirational story of the park's first female ranger.<br><br>Throughout, Olson offers up humorous accounts of celebrity visits and astounding adventures and even includes a chapter dedicated to jokes told in the cave over the years. Whether you're visiting the national park, thinking about visiting, or just curious about a place recognized as one of the world's greatest natural wonders, don't miss this delightful guide to the wild and wonderful subterranean world of Mammoth Cave.",
