       "pagesinfile":"225",
       "descr":"<DIV>Just when you thought you knew all there was to know about cats comes the ultimate—and unexpected—guide to taking your cat into the wild. Here are cats walking on a leash. Cats<I> hiking</I> on a leash. Cats tramping through snow. Cats camping. Cats kayaking, canoeing, even surfing—yes, cats who love water.<BR /><BR /> When animal writer and active hiker Laura Moss couldn’t find an online resource for hitting the trail with her cat, she created one. AdventureCats.org took off like wildfire, with attention from <I>Wired</I>, the<I> Huffington Post</I>, <I>Outside</I> magazine, <I>BuzzFeed</I>, and much more. Now, the book <I>Adventure Cats</I>—a collection of jaw-dropping photographs, inspiring stories of real-life cats, and all the how-to a cat owner needs—will take readers and their cats well beyond the backyard. Learn how to leash-train a cat. What to do if you encounter wildlife on the trail. Plus, winter safety tips, and how to bring a little bit of the outdoors to an indoor cat.<BR /><BR /> The stories themselves are catnip for animal lovers, from Nanakuli, the one-eyed cat who hangs ten; to Georgie, a four-year-old gray tabby who lives on a sailboat; to Quandary, who not only insists on hiking with her family but also teaches them a valuable lesson: When you follow your cat’s natural tendency to wander, you experience the outdoors at a slower, richer pace. This book will delight every cat person, regardless of whether their pet is inclined to adventure. (Take the quiz at the beginning of the book to find out!)<BR /><BR />  </DIV>",
