       "descr":"<div><p><em>Humans of New York</em> meets <em>The French Cat</em> in this carefully cultivated, gorgeous full-color collection featuring New York’s iconic felines and the stories behind them.</p><p>They inhabit New York City’s most legendary and coziest spots—the Algonquin Hotel, a whiskey distillery, Bleecker Street Records, and a host of yoga studios, bodegas, bookstores, and bike shops in between. True New Yorkers—masters of people watching—they perch on wine crates, piles of books, and a classic hotel countertop, taking in the activity around them. Depending on their mood, these cats will ignore enthusiastic admirers, offer a few delightful purrs, or occasionally even take a swipe. Some even find a mouse or two to chase.</p><p><em>Shop Cats of New York</em> introduces forty of New York’s favorite felines—all who have an extraordinary story to tell. Popular cat blogger Tamar Arslanian and Instagram pet photographer Andrew Marttila capture these deeply loved and well cared for animals in their city habitat and reveal how they came to reign over their urban kingdoms.</p><p>A celebration of some of the city’s most revered citizens and a unique look at New York life, this enchanting illustrated volume is a must for every cat lover, and every Big Apple devotee.</p></div>",
