       "descr":"<div><p>There may be 100 million pet cats in this country, but who says that means they’re domesticated? Sure, they clean themselves, use a litter box, and hunt rodents, but cats are also territorial beasts who think furniture is meant for claw sharpening, and that running water is always better than still.<br>    In this inventive, surprisingly funny, and highly entertaining and practical book, Mac Delaney addresses the quirks of cat behavior through the mindset of an aerospace engineer (because that’s what he is!)—and gives us 10 projects that solve the most common sources of friction affecting cats and their doting owners.<br>    Take that preference for running water. Because cats don’t trust still water (in the wild, a stagnant pool can harbor disease), they’re often dehydrated and cranky. Here’s how to build not one but two different fountains that will provide fresh, moving water. Or another problem: Cats, diminutive in stature, can feel inferior around humans, causing them to act out in negative ways. The solution: Erect a cat shelf on your wall, giving your pet a prime perch and a height advantage. And that furniture scratching problem? Construct the Cat Cave—it has angled surfaces for optimal scratching, a curved top for ergonomic lounging, a carpeted interior for perfect napping, and an escape route out back for emergency exits.<br>    For any cat lover with a modicum of DIY skills, here’s a whole new approach to living happily ever after with your pet(s).  </p></div>",
